import React from 'react'
import { Descriptions, Button, List, Avatar, Space } from 'antd';
import { UserOutlined } from '@ant-design/icons';

const listData = [];
for (let i = 0; i < 1; i++) {
    listData.push({
        href: 'https://ant.design',
        title: `ant design part ${i}`,
        avatar: 'https://zos.alipayobjects.com/rmsportal/ODTLcjxAfvqbxHnVXCYX.png',
        description:
            'Ant Design, a design language for background applications, is refined by Ant UED Team.',
        content:
            'We supply a series of design principles, practical patterns and high quality design resources (Sketch and Axure), to help people create their product prototypes beautifully and efficiently.',
    });
}



const BookingCardAntd = () => {
    return (
        <List
            itemLayout="vertical"
            size='default'
            style={{
                width:'100%',
            }}
            dataSource={listData}
            renderItem={item => (
                <List.Item
                    style={{
                        width:'100%',
                        height:'180px',
                        padding:'10px 0px 0px 0px', 
                        marginBottom:'10px',
                        // border:'3px solid #5C082A',
                        borderRadius:'10px',
                        backgroundColor:'white'
                    }}
                    key={item.title}
                >
                    <List.Item.Meta
                        // avatar={<Avatar src={item.avatar} />}
                        style={{backgroundColor:'#5C082A', marginBottom:'0px'}}
                        title={
                            <div style={{backgroundColor:'white',paddingRight:'30px',}}>
                                <div style={{fontSize:'20px',textAlign:'right', fontFamily:'Montserrat'}}>
                                    <span style={{fontSize:'15px'}}><UserOutlined /> 5</span> | 27 March 2020</div>
                                <div style={{fontSize:'30px',textAlign:'right', fontFamily:'Montserrat', fontWeight:'bold'}}>
                                    Cat on the roof #3
                                </div>
                            </div>}
                        description={
                            <div style={{display:'flex', flexWrap:'wrap'}}>
                                <div style={{width:'50%', display:'flex', justifyContent:'center', alignContent:'center', height:'100%      '}}>
                                    <h3 style={{fontSize:'30px',textAlign:'right', fontFamily:'Montserrat', color:'white'}}>STATUS</h3>
                                </div>
                                <div style={{paddingRight:'30px',width:'50%',height:'100%'}}>
                                  <span style={{fontSize:'13px',textAlign:'right', fontFamily:'Montserrat', color:'white', width:'100%', wordBreak:'break-all'}}>descriptionfadsfasdfasflasdfsaldfkjasdjf;okalfkjdskasfljkas;jflsa</span>
                                </div>
                            </div>
                        }
                    />
                    <Button style={{width:'50%'}}>ACCEPT</Button>
                    <Button style={{width:'50%'}}>DECLINE</Button>
                </List.Item>
            )}
        />
    )
}

export default BookingCardAntd
